import CarouselSingle from "./CarouselSingle";
import { Carousel } from 'react-bootstrap';

function CarouselSet() {

    return (
    <div className="DarkGreenBox">
        <div className="LightGreenBox ">
            <h2 className="LightLine LightGreenFontShade FullWidthContainer LineTextLine LineTextLine CursiveFont MdFont">Frequently Asked</h2>

            <div className="container" style={{height:"30%"}}>

            <Carousel fade>

              <CarouselSingle />
              <CarouselSingle />
              <CarouselSingle />

            </Carousel> 


            </div>

            <div className="LineTextLine LightLine" ></div>
        </div>
    </div>
 );
}

export default CarouselSet;
